B.I1=new A.fv("marriage","Marriage 365","UX Research","In this project I worked for Eazy Design Agency as part of the UX Research team.\n            \nThe main goal was research for a new mobile app for Marriage365 . This is a website specialized in consulting for couples and marriage advices.\n            \nI performed diferents task such as strategy, design, discovery and requirements.\n            \nWe conduct quantitative and qualitative research. Surveys (online, in depth, focus groups), remote interviews, gathering data and its subsequent analysis.\n            \nI also builded user personas, empathy and journey maps,  revealing user needs and pain points  for better understanding the end-to-end user journey.","","cover.webp",B.n7,B.b6,!1,3)
